import React, { useContext } from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// react components for routing our app without refresh
import { Link } from "react-router-dom";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// @material-ui/icons
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Parallax from "components/Parallax/Parallax.js";
// sections for this page
import HomeLinks from "components/Header/HomeLinks.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import Posts from "./Posts.js";

import styles from "assets/jss/material-kit-react/views/components.js";
import AuthContext from "../../context/post/postContext";

const useStyles = makeStyles(styles);

export default function Home(props) {
   const classes = useStyles();
   const { ...rest } = props;
   const authContext = useContext(AuthContext);

   return (
      <div>
         <Header
            brand="JOJO"
            leftLinks={<HomeLinks />}
            rightLinks={<HeaderLinks />}
            fixed
            color="transparent"
            changeColorOnScroll={{
               height: 250,
               color: "white",
            }}
            {...rest}
         />
         <Parallax image={require("assets/img/754790.png")}>
            <div className={classes.container}>
               <GridContainer>
                  <GridItem>
                     <div className={classes.brand}>
                        <h1 className={classes.title}>JOJO FANTOM</h1>
                        <h3 className={classes.subtitle}>
                           <strong>News:</strong> JoJo's Bizarre Adventure began
                           not with Stands, but with the power of the Ripple,
                           aka Hamon, bringing us our first Joestar in the form
                           of Jonathan, the teenager who found himself fighting
                           against his rival, Dio Brando, and one fan has
                           decided to take a trip back into the past during the
                           days of Phantom Blood. With Jonathan being taught how
                           to wield the vampire slaying ability by the insanely
                           dressed Will Anthonio Zeppeli, the first Joestar of
                           the franchise was able to leave his mark by not only
                           defeating Dio, but by introducing a brand new world
                           to anime fans!
                        </h3>
                     </div>
                  </GridItem>
               </GridContainer>
            </div>
         </Parallax>

         <div className={classNames(classes.main, classes.mainRaised)}>
            <Posts />
         </div>
         <Footer />
      </div>
   );
}
